import { Link } from 'react-router-dom';
import Post from '../Post/Post';
import './Posts.css';
import posts from './postsData'; // Импортируем массив постов

const Posts = () => {
  return (
    <div className="posts">
      {posts.map((post) => ( <Link to={ <Post key={post.id} post={post} />} />
      ))}
    </div>
  );
}

export default Posts;
